import './rightbar.css';

const Rightbar = () => {
  return (
    <div className="rightbar">
      <div className="rightbar-wrapper">
        <div className="rightbar-status-container">
          <ul className="rightbar-status-list">
            <li className="rightbar-status-friend">
              <img
                className="rightbar-friend-img"
                src="/assets/person/2.jpeg"
                alt="Friend Image"
              />
              <span className="rightbar-friend-name">Jane Doe</span>
              <span className="rightbar-status">Playing LoL</span>
            </li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Rightbar;
